column8:
Étudiant à la Faculté de
Théologie
;

Son premier cours est fixé au 24 juillet

  1431

;

Étudiant en décret (Paris) en quatrième année d'audition en

  1387

;

Étudiant en théologie depuis six ans en

  1379

;

Étudiant en théologie depuis dix ans auprès d'
Amaury de BENE
;

Mais il reste en difficulté financière : "Quantum ad primum,
Everardus JOHANNIS de Harlem
bacularius in artibus licenciandus, juravit in facie nacionis quod facta omni diligencia quam quis tenetur facere, se protunc non habere facultatem satisfaciendi nacioni pro bursis nec habere vadia, que possint ascendere ad valorem bursarum; et in casu quod eo ad fortunam pinguiorem pervenerit, ipsum satisfacturum nacioni, preveniendo requestam nacionis. Et sic patet quid factum erat quantum ad primum, quia placuit audire juramenta sua et audivit" ;

Licencié en droit canon attesté en

  1336

;

Maître ès arts (Paris) attesté en janvier

  1331

;
